import React, {useState} from "react";


function App() {
  const baseURL= "https://tih-api.stb.gov.sg/content/v1/attractions/search?keyword=park&sortBy=name&sortOrder=asc&language=en&apikey=AALYYjcafVG4UE8jddwk7OeqnWAvgluD";

  const fetchAttractions = async(url) => {
    try{
      const res = await fetch(url);
      const attractions = await res.json();
      console.log(attractions.data);
      setImage(attractions.data[0].images[0].url)
    } catch (err) {
      console.log(err.message)
    }
  }

  const retrieveData = () => {
    fetchAttractions(baseURL)
  }

  const [image, setImage] = useState("");
  return (
    <div>
      <h2>GA SEI-33</h2>
      <button onClick = {retrieveData}>All Park Attractions</button>
      <img src = {image}/>
    </div>
  );
}

export default App;
